export const draw_svg = function(ctx, type, x, y, size, rot, fill) {
  if (!svgs.hasOwnProperty(type)) throw "No such SVG type: " + type;
  if (fill != undefined) ctx.fillStyle = fill;
  ctx.translate(x, y);
  ctx.rotate(rot * Math.PI / 180);
  ctx.translate(- size / 2, - size / 2);
  ctx.scale(size / 24, size / 24);
  ctx.fill(new Path2D(svgs[type]));
  ctx.setTransform(1, 0, 0, 1, 0, 0);
}